message:
*Selecionei algumas frases importantes do presidente com o povo, nessa tarde de sexta-feira, 09/12, no Palácio da Alvorada.*

“As Forças Armadas devem respeito ao seu povo e a constituição”;
“As Forças Armadas são o último obstáculo ao socialismo”;
“Quem decide o meu futuro são vocês”;
“Quem decide para onde vão as Forças Armadas são vocês";
“Cada minuto é valioso";
“Vamos fazer a coisa certa”;
“Nada está perdido”;
“Se Deus quiser, tudo dará certo no momento oportuno”.
